  var adresponsiblesId = [];
  var removeresponsiblesId = [];
  var adfollowersId = [];
  var adsupertasksId = [];
  var removesupertasksId = [];
  var adparentsId = [];
  var removeparentsId = [];
  adsharedId = inputs.adshared;
  removesharedId = inputs.removeshared;
  adresponsiblesId = inputs.adresponsibles;
  removeresponsiblesId = inputs.removeresponsibles;
  adfollowersId = inputs.adfollowers;
  adsupertasksId = inputs.adsupertasks;
  removesupertasksId = inputs.removesupertasks;
  adparentsId = inputs.adparents;
  removeparentsId = inputs.removeparents;
  if(adsharedId != ""){
    outputs.adsharedid = JSON.stringify(adsharedId);
  }
  else{
    outputs.adsharedid = "";
  }
  if(removesharedId != ""){
    outputs.removesharedid = JSON.stringify(removesharedId);
  }
  else{
    outputs.removesharedid = "";
  }
  if(adresponsiblesId != ""){
    outputs.adresponsiblesid = JSON.stringify(adresponsiblesId);
  }
  else{
    outputs.adresponsiblesid = "";
  }
  if(removeresponsiblesId != ""){
    outputs.removeresponsiblesid = JSON.stringify(removeresponsiblesId);
  }
  else{
    outputs.removeresponsiblesid = "";
  }
  if(adfollowersId != ""){
    outputs.adfollowersid = JSON.stringify(adfollowersId);
  }
  else{
    outputs.adfollowersid = "";
  }
  if(adsupertasksId != ""){
    outputs.adsupertasksid = JSON.stringify(adsupertasksId);
  }
  else{
    outputs.adsupertasksid = "";
  }
  if(removesupertasksId != ""){
    outputs.removesupertasksid = JSON.stringify(removesupertasksId);
  }
  else{
    outputs.removesupertasksid = "";
  }
  if(adparentsId != ""){
    outputs.adparentsid = JSON.stringify(adparentsId);
  }
  else{
    outputs.adparentsid = "";
  }
  if(removeparentsId != ""){
    outputs.removeparentsid = JSON.stringify(removeparentsId);
  }
  else{
    outputs.removeparentsid = "";
  }
})(inputs, outputs);

